import React from "react";

import {
    Container,
    ContainerMessage,
    Message
} from './styles'

type Prop = {
    message: string;
}

export function Messages({ message }: Prop) {

    const isMessage = true

    return (
        <Container>
            <ContainerMessage
                style={{
                    backgroundColor: isMessage ? '#EEF4F3' : '#b3ddbd',
                    marginRight: isMessage ? 80 : 0,
                    marginLeft: isMessage ? 0 : 80,
                }}>
                <Message>{message}</Message>
            </ContainerMessage>
        </Container>
    )
}
